import React, { Component } from 'react';
import { Icon, Button, ButtonGroup } from '@blueprintjs/core';
import '@fortawesome/fontawesome-free/css/all.min.css';
//import '../NavBar/Navbar.css'
import './Sidebar.css';

export default class Sidebar extends Component {
   render() {
      return side_old();
   }
}

const side_old = () => {
   return (
      <div className='outer'>
         <nav class='side-bar pl-0 no-border'>
            <ButtonGroup large vertical>
               <Button minimal icon='home' fill></Button>
               <Button minimal icon='dashboard'></Button>
            </ButtonGroup>
         </nav>
      </div>
   );
};
